import React from 'react';
import ReactDOM from 'react-dom';

class StudentList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: []
          };
       debugger;
    }

    componentDidMount(){
        fetch('https://6079395e460a6600174fb472.mockapi.io/api/v1/Students/1')
        .then(res => res.json())
       
        .catch(console.log) 
       
    }



    render() {
        return (
            <div>
                <p>Student Data{this.props.rowId}</p>       

                
      


            </div>

            
        );

    }
}

export default StudentList;
